import React from 'react';
import brain from './brain.png';
import './Navigation.css';
const Navigation = () => {
    return (
        <div className="card">
            <header className="black-80 tc pv2 avenir">
              <img height="60"
                   width="60" 
                   alt="brain logo" 
                   src={brain}></img>
                <h1 className="mt2 mb0 baskerville i fw1 f1">Smart Brain</h1>
                <div style={{display:'flex',justifyContent:'flex-end'}}>
                <nav className="mw7 bt bb mt2 mr3" >
                    <a className="f4 f5-l link bg-animate black-80  grow dim dib pa3 ph4-l"  href="/">Home</a>
                    <a className="f4 f5-l link bg-animate black-80  grow dim dib pa3 ph4-l"  href="/portfolio">Signup</a>
                    <a className="f4 f5-l link bg-animate black-80  grow dim dib pa3 ph4-l"  href="/about">Signin</a>
                </nav>
                </div>
            </header>
        </div>
    );
}

export default Navigation;
